def get_support(num_of_customers, routes):
    N = list(range(1,num_of_customers + 1))
    V = [0] + N
    A = [(i, j) for i in V for j in V if i != j]
    return_list = []
    for route in routes:
        for arc in route:
            return_list.append(arc)
    support = {(i,j): return_list.count((i,j)) / len(routes)  for i,j in A} 
    print(support)

